              "col2": "A student, instructure, or administrator uses a browser to login to the STEDE environment.  Authorizations associated with the login determine available operations (launch course, perform admin functions, perform customization functions, etc.)\u003cbr/\u003e\u003cbr/\u003eNOTE: Some courses may be anonymous and not require login to launch. Anonymous courses are not eligible for a credential. \u003c/br\u003e"
